import styled from "styled-components"
import bgImage from '../../assets/images/introBg.svg';
import bgImageDesk from '../../assets/images/introBg.svg';
import { useSizeRatio } from "../../hooks/useSizeRatio";
import { MarkeredText, PurpleText } from "../shared/Texts";

const Wrapper = styled.div`
    position: fixed;
    inset: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    background: url(${'"' + bgImage + '"'}) no-repeat 0 0 /cover;
    @media screen and (min-width: 640px) {
        background-image: url(${'"' + bgImageDesk + '"'});
    }
`;

const ContentWrapper = styled.div`
    position: relative;
    width: calc(100% - ${({ $ratio }) => $ratio * 14}px);
    height: calc(100% - ${({ $ratio }) => $ratio * 68}px);

    @media screen and (min-width: 640px) {
        width: calc(100% - ${({ $ratio }) => $ratio * 80}px);
        height: calc(100% - ${({ $ratio }) => $ratio * 55}px);
    }
`;

const SvgDesktop = styled.svg`
    position: relative;
    z-index: 1;
    display: none;

    @media screen and (min-width: 640px) {
        display: block;
    }
`

const SvgMobile = styled.svg`
    display: block;
    position: relative;
    z-index: 1;

    @media screen and (min-width: 640px) {
        display: none;
    }
`
const SvgDesktopText = styled.svg`
    position: absolute;
    inset: 0;
    z-index: 5;
    display: none;

    @media screen and (min-width: 640px) {
        display: block;
    }
`

const SvgMobileText = styled.svg`
    position: absolute;
    inset: 0;
    z-index: 5;

    @media screen and (min-width: 640px) {
        display: none;
    }
`

const SvgDesktopPic = styled.svg`
    position: absolute;
    inset: 0;
    z-index: 3;
    display: none;

    @media screen and (min-width: 640px) {
        display: block;
    }
`

const SvgMobilePic = styled.svg`
    display: block;
    position: absolute;
    inset: 0;
    z-index: 3;

    @media screen and (min-width: 640px) {
        display: none;
    }
`;


